      <div className="case-study-header">
        <h1 className="case-study-title">New Hel.fi</h1>
        <p className="case-study-subtitle">Citizen-centric renewal of the largest website in Finland</p>
        <div className="case-study-details">
          {/* Add details here */}
        </div>
      </div>
      <CaseStudy
